import React, { Component } from 'react';
import './Projects.css';
import { Card, Paper, Grid, CardActionArea, CardContent, CardMedia, Typography } from '@material-ui/core';
import { PROJECTS } from '../../resources/list_of_projects';

class Projects extends Component {
    render() {
        return (
            <div className="projects-component">
                <Paper>
                    <Grid container spacing={10} justify="space-around" alignItems="center">
                        {PROJECTS.map((project, index) => {
                            return (
                                <Grid item key={project.name}>
                                    <Card className="card-card">
                                        <CardActionArea>
                                            <CardMedia
                                                className="card-media"
                                                image={project.pic}
                                                title={project.name}
                                            />
                                            <CardContent>
                                                <Typography gutterBottom variant="h5" component="h2">
                                                    {project.name}
                                                </Typography>
                                                <Typography variant="body2" color="textSecondary" component="p">
                                                    {project.description}
                                                </Typography>
                                            </CardContent>
                                        </CardActionArea>
                                    </Card>
                                </Grid>
                            )
                        })}
                    </Grid>
                </Paper>
            </div>
        )
    }
}

export default Projects
